import{BrowserRouter as Router ,Switch,Route} from 'react-router-dom'
import './App.css';
import Home from './components/Home'
import Footer from './components/Footer/index'

function App() {
  return (
    <Router>
          <div className="App">
          <Switch>
           <Route exact path='/' component={Home}/> 
          </Switch>
          <Footer/>
          </div>
    </Router>
  );
}

export default App;
